import React from "react";
import "./BigCategories.css";

const BigCategories = () => {
  return (
    <div>
      <div>
        <img className="redMeat-image" src="https://i.insider.com/60ff193df350d50019590561?width=1200&format=jpeg"></img>
      </div>
    </div>
  );
};

export default BigCategories;
